private void processColocationProperties(ColocateTableIndex colocateTableIndex,String colocateGroup,Database db,OlapTable olapTable,boolean expectLakeTable) throws DdlException {
  if (Strings.isNullOrEmpty(colocateGroup)) {
    return;
  }
  if (olapTable.isLakeTable() != expectLakeTable) {
    return;
  }
  String fullGroupName=db.getId() + "_" + colocateGroup;
  ColocateGroupSchema groupSchema=colocateTableIndex.getGroupSchema(fullGroupName);
  if (groupSchema != null) {
    groupSchema.checkColocateSchema(olapTable);
  }
  colocateTableIndex.addTableToGroup(db.getId(),olapTable,colocateGroup,null,false);
  olapTable.setColocateGroup(colocateGroup);
}

