void setLakeStorageInfo(OlapTable table,Map<String,String> properties) throws DdlException {
  boolean enableStorageCache=PropertyAnalyzer.analyzeBooleanProp(properties,PropertyAnalyzer.PROPERTIES_ENABLE_STORAGE_CACHE,true);
  long storageCacheTtlS=0;
  try {
    storageCacheTtlS=PropertyAnalyzer.analyzeLongProp(properties,PropertyAnalyzer.PROPERTIES_STORAGE_CACHE_TTL,Config.lake_default_storage_cache_ttl_seconds);
  }
 catch (  AnalysisException e) {
    throw new DdlException(e.getMessage());
  }
  if (storageCacheTtlS < -1) {
    throw new DdlException("Storage cache ttl should not be less than -1");
  }
  if (!enableStorageCache && storageCacheTtlS != 0 && storageCacheTtlS != Config.lake_default_storage_cache_ttl_seconds) {
    throw new DdlException("Storage cache ttl should be 0 when cache is disabled");
  }
  if (enableStorageCache && storageCacheTtlS == 0) {
    throw new DdlException("Storage cache ttl should not be 0 when cache is enabled");
  }
  boolean enableAsyncWriteBack=PropertyAnalyzer.analyzeBooleanProp(properties,PropertyAnalyzer.PROPERTIES_ENABLE_ASYNC_WRITE_BACK,false);
  if (!enableStorageCache && enableAsyncWriteBack) {
    throw new DdlException("enable_async_write_back can't be turned on when cache is disabled");
  }
  FilePathInfo pathInfo=stateMgr.getStarOSAgent().allocateFilePath(table.getId());
  table.setStorageInfo(pathInfo,enableStorageCache,storageCacheTtlS,enableAsyncWriteBack);
}

void buildPartitions(Database db,OlapTable table,List<Partition> partitions) throws DdlException {
  if (partitions.isEmpty()) {
    return;
  }
  int numAliveBackends=systemInfoService.getAliveBackendNumber();
  int numReplicas=0;
  for (  Partition partition : partitions) {
    numReplicas+=partition.getReplicaCount();
  }
  if (partitions.size() >= 3 && numAliveBackends >= 3 && numReplicas >= numAliveBackends * 500) {
    LOG.info("creating {} partitions of table {} concurrently",partitions.size(),table.getName());
    buildPartitionsConcurrently(db.getId(),table,partitions,numReplicas,numAliveBackends);
  }
 else   if (numAliveBackends > 0) {
    buildPartitionsSequentially(db.getId(),table,partitions,numReplicas,numAliveBackends);
  }
 else {
    throw new DdlException("no alive backend");
  }
}

